import './App.css';
import Header from './components/Header/index';
import pic from './components/image/smarthome.jpg';
import { FaHouseUser } from "react-icons/fa";

function App() {
  return (
    <div className="App">
      <Header />

      <div className="main">
        <img src={pic} alt="pic" />

        <div className='login'>
          {/* <Route> */}
          <span className='dot'>
            <FaHouseUser className='logo' />
          </span>
          {/* </Route> */}

          <div className='form_title'>
            LOGIN
          </div>
          <form>
            <input className='username' type="text" id="username" name="username" placeholder='&#xF002Username'></input><br/>
            <input className='username' type="text" id="pass" name="pass" placeholder='Password'></input><br/>
            <input type="submit" value="Submit"></input>
          </form>
        </div>
      </div>
    </div>
  );
}

export default App;
